import React from "react";
import ReactDOM from "react-dom";
import Head from "./Head";
import Body from "./Body";
import Footer from "./Footer";

ReactDOM.render(
	<div>
		<Head/>
		<Body/>
		<Footer/>
	</div>,
	document.querySelector("#container")
);
